import styled from 'styled-components';


const HeaderStyled = styled.header`
     background-Color: #f5dfa2;
        padding: 10px;
`;
const titleInput = styled.input`
    padding: 10px;
`;
const contentsInput = styled.input`
    padding: 10px;
`;
const FormTagContainer = styled.form`
    
`
function Header() {

    return (
    <div>
        <HeaderStyled>
        헤더입니다.
        </HeaderStyled>
        <FormTagContainer>
            <div>
      <titleInput type="text" placeholder="제목을 입력하세요"/>
      </div>
      <div>
        <contentsInput type="text" placeholder="내용 입력" />
        </div>
        </FormTagContainer>
    </div>  
    )  
}

export default Header;
